import { createIcon } from "../icon/createIcon";

export const FolderOpenIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="FolderOpenIcon">
    <path d="m1 10 3-6h7V3h1v9H0V1h4.118l2 1H11v1H5.882l-2-1H1v8z" />
  </svg>,
  "FolderOpen",
  "folder open"
);
